Post.create!([
  {title: "ng bu futsal Trn Anh T: C mt mnh h thm lng", body: "<p style=\"text-align: justify; margin-left: 120px;\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/9/content_Anh-Tu-8772-1455855857.jpg\" style=\"width: 500px; height: 390px;\" /></p>\r\n\r\n<p style=\"text-align: justify;\">c xem nh &quot;Ch&uacute;a sn l&acirc;m&quot; mt c&otilde;i ca futsal Vit Nam, nhng danh ting v &ocirc;ng bu tui Dn ch c qung i qun ch&uacute;ng bit ti sau khi tuyn Vit Nam ot v&eacute; d FIFA Futsal World Cup.</p>\r\n\r\n<p style=\"margin-left: 40px; text-align: justify;\">&nbsp;<a alt=\"ng n World Cup ca futsal Vit Nam\" href=\"http://thethao.vnexpress.net/photo/hinh-bong-da/duong-den-world-cup-cua-futsal-viet-nam-3356684.html\" title=\"ng n World Cup ca futsal Vit Nam\">ng n World Cup ca futsal Vit Nam</a>&nbsp;/&nbsp;<a alt=\"Giy pht v o ca futsal Vit Nam khi lm nn a chn\" href=\"http://thethao.vnexpress.net/photo/hinh-bong-da/giay-phut-vo-oa-cua-futsal-viet-nam-khi-lam-nen-dia-chan-3356686.html\" title=\"Giy pht v o ca futsal Vit Nam khi lm nn a chn\">Gi&acirc;y ph&uacute;t v o&agrave; ca futsal Vit Nam khi l&agrave;m n&ecirc;n a chn</a></p>\r\n\r\n<p style=\"text-align: justify;\">Ch trong &iacute;t ng&agrave;y, c&aacute;i t&ecirc;n Trn Anh T&uacute; c ngi h&acirc;m m nhc i nhc li vi mt  c&oacute; l bng c chc nm trc gp li. D&ugrave; rng, trc k t&iacute;ch v&agrave;o World Cup ca i futsal Vit Nam, &ocirc;ng &atilde; l&agrave; Ch tch Li&ecirc;n o&agrave;n b&oacute;ng &aacute; TP H Ch&iacute; Minh (HFF), gi mt gh thng trc Ban chp h&agrave;nh Li&ecirc;n o&agrave;n b&oacute;ng &aacute; Vit Nam (VFF), mt doanh nh&acirc;n th&agrave;nh t, ch s hu i futsal mnh nht nc Th&aacute;i Sn Nam v&agrave; t&agrave;i tr cho rt nhiu gii u.</p>\r\n\r\n<p style=\"text-align: justify;\">S d t&ecirc;n &ocirc;ng &iacute;t xut hin tr&ecirc;n truyn th&ocirc;ng ln mng x&atilde; hi v&igrave; &ocirc;ng thuc tu&yacute;p ngi k&iacute;n ting, kh&ocirc;ng th&iacute;ch &aacute;nh b&oacute;ng t&ecirc;n tui. C&aacute;i c&aacute;ch &ocirc;ng n vi futsal l&agrave; rt cn c, khi i t phong tr&agrave;o dn l&ecirc;n chuy&ecirc;n nghip - nh c&ocirc;ng vic l&agrave;m n ca &ocirc;ng cng bt u t nhng bc nh nht. &Ocirc;ng T&uacute; th&iacute;ch b&oacute;ng &aacute; v&ocirc; c&ugrave;ng, nhng v&igrave; thot u m&ocirc; h&igrave;nh c&ocirc;ng ty nh qu&aacute; n&ecirc;n &agrave;nh phi &aacute;... futsal.  ri t &oacute;, s vn l&ecirc;n ca c&ocirc;ng ty &ocirc;ng &atilde; i lin vi s ph&aacute;t trin ca m&ocirc;n b&oacute;ng &aacute; trong nh&agrave;  Vit Nam.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td style=\"text-align: justify;\">\r\n\t\t\t<p style=\"margin-left: 160px;\"><img alt=\"ong-bau-futsal-tran-anh-tu-co-mot-manh-ho-tham-lang\" data-natural-width=\"500\" data-pwidth=\"470.40625\" data-width=\"500\" src=\"http://img.f1.thethao.vnecdn.net/2016/02/19/futsal-2042-1455855856.jpg\" /></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p style=\"text-align: justify;\">&Ocirc;ng T&uacute; c xem l&agrave;&nbsp;ngi &atilde; mang futsal v vi Vit Nam v&agrave; a m&ocirc;n th thao &iacute;t bit vi i ch&uacute;ng n&agrave;y n c th&agrave;nh c&ocirc;ng hin ti. nh:&nbsp;<em>LS</em>.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: justify;\">Khi tuyn futsal nc nh&agrave; n Colombia d World Cup thi gian ti, ch&uacute;ng ta s thy mt Vit Nam tht lc l&otilde;ng gia nhng anh t&agrave;i ca th gii.  nhng cng quc y, futsal &atilde; ph&aacute;t trin t rt l&acirc;u, l&agrave; m&ocirc;n th thao c mn chung v&agrave; u t b&agrave;i bn. C&ograve;n  Vit Nam, m&ocirc;n n&agrave;y mi chp chng nhng bc i u ti&ecirc;n v&agrave; loay hoay t&igrave;m kim ch chuy&ecirc;n nghip cha xong. V&agrave; chng ng a Vit Nam t con s kh&ocirc;ng tr&ecirc;n bn  futsal mt bc l&ecirc;n thi&ecirc;n ng World Cup phn ln nh n lc ca &ocirc;ng T&uacute; sut gn mt thp k qua. &Ocirc;ng thu&ecirc; HLV cho i tuyn, &ocirc;ng t chc nhng gii futsal nh k, &agrave;i th kinh ph&iacute; cho i tuyn v&agrave; m c&aacute;c trung t&acirc;m &agrave;o to tr.</p>\r\n\r\n<p style=\"text-align: justify;\">Ngi &agrave;n &ocirc;ng y c&ograve;n ki&ecirc;m c vai tr&ograve;... anh nu&ocirc;i. &Ocirc;ng ch ca nh&agrave; ph&acirc;n phi thit b in s mt Vit Nam rt th&iacute;ch i ch v&agrave; t m&igrave;nh nu cm cho &quot;bn nh&quot; - c&aacute;ch &ocirc;ng gi c&aacute;c cu th. Vi c&aacute;c cu th, &ocirc;ng va l&agrave; v sp kh&oacute; t&iacute;nh, y&ecirc;u cu cao trong c&ocirc;ng vic, va l&agrave; mt ngi thy cc k gn gi, t&igrave;nh cm.</p>\r\n\r\n<p style=\"text-align: justify;\">y l&agrave; v&igrave; &ocirc;ng T&uacute; cha bao gi qu&ecirc;n qu&aacute; kh h&agrave;n vi. Khi y, &ocirc;ng tng l&agrave;m ph bp tr&ecirc;n t&agrave;u. &Ocirc;ng c&oacute; nim am m&ecirc; c bit vi c&ocirc;ng vic nu nng v&agrave; vn gi th&oacute;i quen y ngay khi &atilde; th&agrave;nh t. Kh&ocirc;ng ch l&agrave;m bp, &ocirc;ng c&ograve;n kinh qua nhiu c&ocirc;ng vic nh bo v, t vn lut, thy dy tin hc trc khi tr th&agrave;nh mt doanh nh&acirc;n. Con ng y to rt nhiu cm hng cho h&agrave;nh tr&igrave;nh khi nghip cho c&aacute;c thanh ni&ecirc;n ng&agrave;y nay. Vy nhng ngi &agrave;n &ocirc;ng quyn lc y, khi c hi v b&iacute; quyt th&agrave;nh c&ocirc;ng, ch n&oacute;i rng: &quot;L&agrave;m nhng g&igrave; m&igrave;nh bit, kh&ocirc;ng bit th&igrave;... kh&ocirc;ng l&agrave;m. V&agrave; &atilde; l&agrave;m th&igrave; ht sc quyt o&aacute;n&quot;.</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td style=\"text-align: justify;\"><img alt=\"ong-bau-futsal-tran-anh-tu-co-mot-manh-ho-tham-lang-1\" data-natural-width=\"500\" data-pwidth=\"470.40625\" data-width=\"500\" src=\"http://img.f1.thethao.vnecdn.net/2016/02/19/Tu-tran-7720-1455855857.jpg\" /></td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p style=\"text-align: justify;\">&Ocirc;ng T&uacute; (&aacute;o sc)&nbsp;nh ngi anh c, ngi cha tinh thn ca c i futsal Vit Nam. nh:&nbsp;<em>LS</em>.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: justify;\"><strong>N&oacute;i &iacute;t l&agrave;m nhiu l&agrave; mt nguy&ecirc;n tc kh&aacute;c ca &ocirc;ng T&uacute;.</strong>&nbsp;Ngo&agrave;i mt ln xut hin tr&ecirc;n truyn th&ocirc;ng vi ph&aacute;t ng&ocirc;n phn i li mt ph&oacute; Ch tch VFF v&igrave; qu&aacute; bc x&uacute;c, c&ograve;n li &ocirc;ng gn nh kh&ocirc;ng l&ecirc;n g&acirc;n l&ecirc;n ct ln n&agrave;o. &Ocirc;ng im lng l&agrave;m c&ocirc;ng vic ca bn th&acirc;n, gi lp trng, kh&ocirc;ng &quot;ng&quot; v mt b&ecirc;n n&agrave;o trong mt m&ocirc;i trng y phc tp nh VFF, ni ch&iacute;nh c&ocirc;ng ty ca &ocirc;ng cng &oacute;ng vai tr&ograve; l&agrave; nh&agrave; t&agrave;i tr.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Trong qu&aacute; tr&igrave;nh ph&aacute;t trin futsal, &ocirc;ng T&uacute; gp kh&ocirc;ng &iacute;t nhng iu ting, t nhng ngi l&agrave;m truyn th&ocirc;ng cha tht s hiu &ocirc;ng cho n nhng &ocirc;ng bu kh&aacute;c cng mun nhy v&agrave;o futsal. H bo &ocirc;ng lng on nn futsal, thao t&uacute;ng i tuyn... Nhng ri th&agrave;nh t&iacute;ch ca i tuyn, s r&uacute;t ra ca nhng &ocirc;ng bu n vi m&ocirc;n n&agrave;y theo dng thi v, cng vi phong tr&agrave;o futsal c duy tr&igrave;  l&agrave;m nn cho i tuyn, &atilde; dn minh chng cho c&aacute;ch l&agrave;m ca &ocirc;ng T&uacute;.</p>\r\n\r\n<p style=\"text-align: justify;\">Nu &ocirc;ng T&uacute;  nc ngo&agrave;i, c&oacute; l ngi ta s v&igrave; &ocirc;ng vi v Vua Midas trong thn thoi Hy Lp, chm &acirc;u cng th&agrave;nh v&agrave;ng. &Ocirc;ng m c&ocirc;ng ty, c&ocirc;ng ty &ocirc;ng tr th&agrave;nh mt trong nhng doanh nghip th&agrave;nh c&ocirc;ng nht nc. &Ocirc;ng l&agrave;m Ch tch HFF, i b&oacute;ng n va v&ocirc; ch quc gia, trong khi i b&oacute;ng nam hng Nht TP HCM ang t mc ti&ecirc;u l&ecirc;n hng V-League. &Ocirc;ng lo cho futsal, i tuyn va ly v&eacute; d World Cup trong s v &ograve;a ca cm x&uacute;c.</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td style=\"text-align: justify;\">\r\n\t\t\t<p style=\"margin-left: 120px;\"><img alt=\"ong-bau-futsal-tran-anh-tu-co-mot-manh-ho-tham-lang-2\" data-natural-width=\"500\" data-pwidth=\"470.40625\" data-width=\"500\" src=\"http://img.f1.thethao.vnecdn.net/2016/02/19/Anh-Tu-8772-1455855857.jpg\" /></p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p style=\"text-align: justify;\">Bu T&uacute; nghn ng&agrave;o khi chia vui vi c&aacute;c cu th sau chin c&ocirc;ng lch s, a futsal Vit Nam n vi u trng World Cup. nh:&nbsp;<em>LS</em>.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: justify;\">C&oacute; mt nh&agrave; b&aacute;o tng hi nh&agrave; b&aacute;c hc huyn thoi Albert Einstein: &quot;Theo gi&aacute;o s th&igrave; liu c&oacute; mt c&ocirc;ng thc n&agrave;o  th&agrave;nh c&ocirc;ng?&quot;.</p>\r\n\r\n<p style=\"text-align: justify;\">Einstein &atilde; h&oacute;m hnh &aacute;p: &quot;Nu cho x l&agrave; s l&agrave;m vic, y l&agrave; s ti&ecirc;u khin, a l&agrave; s th&agrave;nh c&ocirc;ng th&igrave; c&ocirc;ng thc ca t&ocirc;i l&agrave; a = x + y +z&quot;.</p>\r\n\r\n<p style=\"text-align: justify;\">Nh&agrave; b&aacute;o ngc nhi&ecirc;n, hi li:</p>\r\n\r\n<p style=\"text-align: justify;\">- Vy z l&agrave; g&igrave; tha &ocirc;ng?</p>\r\n\r\n<p style=\"text-align: justify;\">Einstein mm ci:</p>\r\n\r\n<p style=\"text-align: justify;\">- L&agrave; bit im lng.</p>\r\n\r\n<p style=\"text-align: justify;\">&Ocirc;ng T&uacute; &atilde; th&agrave;nh c&ocirc;ng theo c&ocirc;ng thc tng t nh th. &Ocirc;ng l&agrave;m vic i&ecirc;n cung, nhng cng d&agrave;nh thi gian cho ti&ecirc;u khin. &Ocirc;ng m&ecirc; chu vn, nghe nhc ca Trn Thu H&agrave; v&agrave; c bit th&iacute;ch... im lng. C&aacute;i s im lng y c&oacute; th l&agrave; do ni t&acirc;m ca mt ngi vn &atilde; phi xa nh&agrave; v&agrave;o Nam lp nghip khi c&ograve;n tr, cng c&oacute; th do c&aacute;i t&iacute;nh ca mt ngi ch th&iacute;ch th hin qua h&agrave;nh ng.</p>\r\n\r\n<p style=\"text-align: justify;\">Khi c nc ang l&ecirc;n cn st v i tuyn futsal, ngi &agrave;n &ocirc;ng &atilde; y&ecirc;u th thao n&oacute;i chung v&agrave; futsal n&oacute;i ri&ecirc;ng vi c tr&aacute;i tim y c&oacute; l trong l&ograve;ng ch c&oacute; duy nht mt c&acirc;u hi: &quot;Nu g&igrave; cho bn nh n nh?&quot;.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Ho&agrave;i Thng</strong></p>\r\n", user_id: 1, picture: "Anh-Tu-8772-1455855857.jpg", view: 124, category_id: 2, impressions_count: nil},
